import React,  { Component } from 'react';
import { connect } from 'react-redux';
import { startTest } from '../store';
import Button from '@material-ui/core/Button';
import { PieChart } from 'react-minimal-pie-chart';



class Start extends Component {
  constructor(props) {
    super(props);
    datas:[{ MarketShare: 30, Company: "Google",    },
    { MarketShare: 30, Company: "Apple",     },
    { MarketShare: 15, Company: "Microsoft", },
    { MarketShare: 15, Company: "Samsung",   },
    { MarketShare: 10, Company: "Other",     },];
    qnumber:0;
    this.doStart = this.doStart.bind(this);
  }

  doStart(e){
    let action = startTest();
    this.props.dispatch(action);
  }

  render(){
    return(
      <div>
        <div style="width">
          <PieChart data ={[
            { title: 'One', value: 10, color: '#E38627' },
            { title: 'Two', value: 15, color: '#C13C37' },
            { title: 'Three', value: 20, color: '#6A2135' },
          ]}/>
        </div>
        <div>
          <Button variant="contained" color="primary" onClick={this.doStart}>
            10問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="secondary" onClick={this.doStart}>
            30問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="primary" onClick={this.doStart}>
            50問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="secondary" onClick={this.doStart}>
            50問Start
          </Button> 
        </div>
      </div>
    );
  }
}

Start = connect((state) => state)(Start);
export default Start;
